import React from 'react';

const AdminDashboard: React.FC = () => {
  return (
    <div className="p-8">
      <h1 className="text-2xl font-bold">Admin Dashboard</h1>
      <p>Admin dashboard content will be loaded here.</p>
    </div>
  );
};

export default AdminDashboard;
